import React from 'react';

import Calendar from '../components/Calendar'
import IntakeList from '../components/IntakeList'

import './Program.css'


const Program = () => {
    const calendarExists = true
    const INTAKES = [{id:'1', number:'1', date:'2020-05-1', hour:'15:30', med:'Omeoprazol'}, {id:'2', number:'2', date:'2020-05-2', hour:'9:30', med:'Aspirina'}]
    return (
     <div>
       {/*  <Calendar calendarExists={calendarExists}></Calendar> */}
        <IntakeList program={true} intakes={INTAKES}></IntakeList>
     </div>
    )
}

export default Program
